// import s from "..style/Posts.module.css";




const Posts = (props) => {
    return (
        <div className={s.blog}>
            <h1 className={s.blogh1}>Блог</h1>
            <div className = {s.container}>
            <div className = {s.row}>
                <div className = {s.col_4}>
                    <div>
                        <img className = {s.img1} src = {img1} alt = "cut1"></img>
                    </div>
                    <div className = {s.textcard}></div>
                </div>
                <div className = {s.col_4}>2</div>
                <div className = {s.col_4}>3</div>
            </div>
            </div>
        </div>
    );
}
export default Posts;
